import React,{Component} from "react";

class Gallery extends Component{
    series_ar = [
        {name:"The simpons", imgUrl:"simpsons.jpg"},
        {name:"Dexter", imgUrl:"dexter.jpg"},
        {name:"South park", imgUrl:"south.jpg"},
        {name:"Family guy", imgUrl:"familyguy.png"},
      ]
  render(){
    return(
        <div>
        <img src={"images/" + this.series_ar[1].imgUrl} />
        <h2>{this.series_ar[1].name}</h2>
        <button>Back</button>
        <button>Next</button>
      </div>

    )
  }
}

export default Gallery;
